import axios from 'axios';
import {getBooksUrl} from "./AppVariables";
export const login = (userName,password)=>{

  axios.get(getBooksUrl()+"/"+userName,{
    auth: {
    username: userName,
    password: password
    }
  })
   .then(res => {
        console.log(res);
        const user = res.data;
        const userRes = "UserName :"+user.userName+" password: "+user.password
        alert(userRes);
  });
}
